function Output(data) {
    if (data === null) {
        return (
            <div>
                <h4>Please search for a company name</h4>
            </div>
        )
    }

    let headers = ['Company name', 'Website Url', 'Logo', 'Primarily used colors', 'Pie chart']
    let table_headers = headers.map( (header) =>  <th>{header}</th>)

    let no_of_colors = 2
    let primary_colors = data.counts_new.slice(0, no_of_colors)
    let column_values = primary_colors.map( (primary_color) => {
        return (
            <div>
                <span class='color-box' style={{backgroundColor:primary_color}}></span>
                <span>{primary_color}</span>
            </div>
        )
    } )

    let table_data = []
    let make_table_data = () => {
        table_data.push(
            <tr>
                <td>{data.company_name}</td>
                <td>{data.website_url}</td>
                <td>
                    <img src={data.website_logo} alt='Logo' />
                </td>
                <td>
                    <div class='flex-vertical'>
                        {column_values}
                    </div>
                </td>
                <td>
                    <img src={data.pie_chart_uri} alt='Pie Chart' />
                </td>
            </tr>
        )
    }

    return (
        <div>
            <table>
                <thead>
                    <tr>
                        {table_headers}
                    </tr>
                </thead>
                <tbody>
                </tbody>
            </table>
        </div>
    )
}

export default Output
